    display: flex;
    margin: 5px 5px;
    width: 10px;
    height: 10px;
    background-color: skyblue;
    `

    return (   
        <StyledArrayBar number = {number} style={{height: `${number}px`}}>
        </StyledArrayBar> 
    )
}
